import React from 'react';
import logo from '../img/logo.png';
import searchIcon from '../img/Search.png';
import icon1 from '../img/group.png';
import icon2 from '../img/Phone.png';
import icon3 from '../img/login.png';
import "./header.css"

const SiteHeader = () => {
  return (
    <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
      <div className="logo">
        <img src={logo} alt="Логотип" />
      </div>
      <div className="search" style={{ marginLeft: 'auto' }}>
        <input type="text" placeholder="Поиск..." />
        <button><img src={searchIcon} alt="Иконка поиска" /></button>
      </div>
      <div className="icons">
        <a href="#"><img src={icon1} alt="Иконка 1" /></a>
        <a href="#"><img src={icon2} alt="Иконка 2" /></a>
        <a href="#"><img src={icon3} alt="Иконка 3" /></a>
      </div>
    </header>
  );
 }
 
 export default SiteHeader;
